import {useSpring, animated} from 'react-spring'
import {Spring} from 'react-spring/renderprops'

function Gallery() {
    return (
        <Spring
  from={{ opacity: 0 }}
  to={{ opacity: 1 }}>
  {props => <div style={props}>hello</div>}
</Spring>
    )
}

export default Gallery;
